code.javascript:
// Quantum Parallax Effect
gsap.registerPlugin(ScrollTrigger);

const quantum = gsap.timeline({
    scrollTrigger: {
        trigger: ".quantum-hero",
        start: "top top",
        end: "bottom top",
        scrub: 1
    }
});

quantum.to(".quantum-particles", {
    y: -200,
    scale: 0.5,
    opacity: 0,
    stagger: 0.02
});

